import React from 'react'

const Home = () => {
  return (
    <div className="container home">
        <div className="text-wrapper">
            <h1>Hello there!<br />I'm Darigan<br />who you looking for.</h1>
            <h2>Web Developer / Software Engineer / CS Student</h2>
            <button to="/contactMe" className="dbutton"></button>
        </div>
    </div>
  )
}

export default Home
